import React from "react";
import { Routes, Route } from "react-router-dom";

import './App.css';

import { LoginPage } from './components/LoginPage';

function App() {
  return (
      <Routes>

        <Route path="/login" element={<LoginPage />} />
        <Route path="*" element={() => { return <div>Other pages</div> }} />

      </Routes>
  );
}

export default App;
